INSERT INTO `comentarios` VALUES (1,'Los gráficos y la jugabilidad son increíbles, pero la trama podría haber sido más profunda.','2023-01-14 05:00:00',4,12,2),(2,'Los escenarios son impresionantes y las secuencias de acción son emocionantes, aunque la duración del juego podría haber sido un poco más larga.','2023-04-10 05:00:00',5,12,4),(3,'La exploración de los entornos es fascinante y los personajes tienen una gran profundidad, pero algunos de los rompecabezas podrían haber sido más desafiantes. ','2022-10-12 05:00:00',4,12,6),(4,'El concepto del juego es interesante, pero la ejecución carece de originalidad y la jugabilidad se vuelve repetitiva rápidamente.','2023-01-14 05:00:00',3,6,8),(5,'El diseño visual es atractivo, pero la falta de profundidad en la mecánica de juego y la falta de contenido adicional hacen que la experiencia sea mediocre.','2023-06-14 05:00:00',3,6,9),(6,'Mirror Forge tiene potencial con su sistema de creación de espejos, pero la falta de variedad en los desafíos y la falta de una narrativa convincente hacen que pierda su atractivo rápidamente.','2023-07-10 05:00:00',2,6,7),(7,'Elden Ring es una obra maestra del género de acción y rol. Su vasto mundo abierto, combate desafiante y narrativa profunda se combinan para ofrecer una experiencia de juego inolvidable. Con su impresionante diseño artístico y una jugabilidad envolvente, es simplemente perfecto.','2023-02-15 05:00:00',5,4,7),(8,'Elden Ring redefine los límites del género con su inmersiva y vasta exploración. La atención al detalle en cada aspecto del juego, desde la narrativa hasta los combates épicos, es excepcional. Una experiencia sin igual que merece el reconocimiento completo.','2023-02-19 05:00:00',5,4,4),(9,'Elden Ring es un logro magistral en el mundo de los videojuegos. La combinación perfecta de desafío, ambientación y narrativa envuelve al jugador en un viaje épico lleno de misterios y descubrimientos. Cada aspecto, desde el diseño de niveles hasta la banda sonora, está cuidadosamente elaborado para brindar una experiencia inigualable.','2023-05-23 05:00:00',5,4,6),(18,'chvere juego\r\n','2023-07-15 05:00:00',NULL,2,6),(19,'una dos 3','2023-07-18 00:12:26',NULL,2,6),(20,'hola123','2023-07-18 00:13:21',NULL,2,6),(21,'prueba321','2023-07-18 00:13:31',NULL,2,6);
